var TranslatorManager={activeLanguage:"",dictionary:[],setActiveLanguage:function(language){this.activeLanguage=language;},loadDictionary:function(dict){this.dictionary[dict.lang]=dict;},get:function(key){if(''==this.activeLanguage)return;return this.dictionary[this.activeLanguage][key]===undefined?'':this.dictionary[this.activeLanguage][key];}}